function Unilista(props) {
    return (
        <div>
            {
                props.unet.map(tieto => {
                    return (
                        <p key={tieto.id}>
                            Unen määrä: {tieto.maara}<br />
                            Päivämäärä: {tieto.pvm}<br />
                            Unen laatu: {tieto.laatu}<br />
                        </p>
                    ) // return
                }) // map
            }
        </div>
    )
}
export default Unilista;
